import React from "react";

function task(){
    return(
        <>
            <div className=" my-[10px] mx-[20px] flex justify-between border border-gray-700 p-[10px]">
                <div className="text-teal-600 text-xl flex-[0.2">
                    <p>10:00 P.M</p>
                </div>
                <div className="text-bold text-xl">
                    <p>Buy household items</p>
                </div>
            </div>
        </>
    )
}

export default task;
